import { Route } from 'react-router-dom';
import { BrowserRouter, Routes } from 'react-router-dom';
import './style/sass.css';


function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" >
        <Route path="*" element="main.js">

        </Route>
      </Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
